import guestForm from './guestForm';
import dashboardSagas from './dashboardSagas';
import { all, fork } from 'redux-saga/effects';

export default function* rootSaga()
{
    yield all([ 
        fork(guestForm),
        fork(dashboardSagas)
    ]);
}
